import React from "react"
import ReactDOM from "react-dom"

const TodoList = () => {
    return(
        <ul>
            <li>Learn React</li>
            <li>Drink coffee</li>
        </ul>
    )
}

const AppHeader = () => {
    return (
        <h1>My todo list</h1>
    )
}

const SearchPanel = () => {
    return (
        <input placeholder="search" />
    )
}

const el = (
    <div>
        <AppHeader />
        <SearchPanel />
        <TodoList />
    </div>
)

console.log(el)

ReactDOM.render(el,
    document.getElementById('root'))
